import { Carousel } from 'react-bootstrap';
import React from 'react';
import ItemCarrossel from './ItemCarrossel';



export default class MeuCarrossel extends React.Component {

	

	render() {
		let myJson = [
			{
				label: 'Projeto Captura Ovo',
				imagesrc: '',
				caption: 'Software para detecção de ovos do mosquito da Dengue.'
			},
			{
				label: 'tooFast',
				imagesrc: '',
				caption: 'Front-end para gerenciamento de e-mails.'
			},
			{
				label: 'Este Site',
				imagesrc: '',
				caption: 'Meu portfólio online.'
			}
		];

		return (
			<div className="col-md-6 col-md-offset-3">
				<Carousel>
					<ItemCarrossel myJson = {myJson}/>
				</Carousel>
			</div>
		);
	}
}
